import React from 'react';

function Map() {
  return (
    <section className="tc-map-style1">
      <div className="map-container">
        {/* First Location */}
        <div className="map-card">
          <h3>Location 1: San Francesco, Italy</h3>
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d18542.46505157743!2d14.887766312855979!3d38.13861377046686!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x13169bb09ae2f91d%3A0x260b042a9d31dd31!2s98063%20San%20Francesco%2C%20Metropolitan%20City%20of%20Messina%2C%20Italy!5e0!3m2!1sen!2seg!4v1700594341684!5m2!1sen!2seg"
            width="100%"
            height="300"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
          ></iframe>
        </div>

        {/* Second Location */}
        <div className="map-card">
          <h3>Location 2: Paris, France</h3>
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2624.999660878196!2d2.29229231567482!3d48.85884437928754!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47e66fcd0f5074b7%3A0x42107a1cb1d2e7f3!2sEiffel%20Tower!5e0!3m2!1sen!2sfr!4v1700594341684!5m2!1sen!2sfr"
            width="100%"
            height="300"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
          ></iframe>
        </div>
      </div>
    </section>
  );
}

export default Map;
